import React from 'react';

import productImage from './images/pizzas/bav.jpg';

const PizzaProducts = function () {

    const PizzaProducts = require('./json/pizzas.json');

    console.log(PizzaProducts.name);

    return (
        <li className="product">
            <div className="product-img"><img src={productImage}></img></div>
            <div className="product-description">
                <h3>Баварская</h3>
                <div className="size-weight">32 см. 600 г.</div>
                <div className="description">Томатный соус, соус Горчичный, Моцарелла, колбаски Пепперони, грудинка, куриная колбаска, лук, Орегано</div>
            </div>
            <div className="add-container">
                <div className="cost">14,62 руб.</div>
                <button className="add-btn">В корзину</button>
            </div>
        </li>
    );
};

export default PizzaProducts;
